VALUES ('3222472864752', 'Feuilletés Saumon - Pizza - Jambon - Fromages', 'Feuilleté Saumon 31,4% : eau - farine de _blé_ - margarine (graisses végétales de palme et de colza - eau - sel - émulsifiant : E471 - correcteur d\'acidité : E330) - préparation déshydratée pour sauce (_lactosérum_ - amidon transformé de pomme de terre - poudre de _lait_ entier - sel - épaississant : E415 - poivre - muscade) - _saumon_  4,1%* (Salmo salar) - _crème_ (_crème_ - stabilisant : E407) - jus de citron - sel - persil - _saumon_ fumé 0,5%* [_saumon_ (Salmo salar) - sel] - _œuf_  entier en poudre - amidon transformé de pomme de terre. Feuilleté Pizza 25,5% : eau - farine de _blé_ - margarine (graisses végétales de palme et de colza - eau - sel - émulsifiant : E471 - correcteur d\'acidité : E330) - préparation déshydratée pour sauce (_lactosérum_ - amidon transformé de pomme de terre - poudre de _lait_ entier - sel - épaississant : E415 - poivre - muscade) - _emmental_  râpé 3%* - poudre de tomate 2,1%* - sel - chapelure (farine de _blé_ - eau - sel - levure)- oignon 0,6%* - _œuf_  entier poudre - arôme naturel - blanc d\'_œuf_ - aïl - herbes de Provence (sarriette - romarin - serpolet - marjolaine - origan - basilic - thym) - poivre noir.  Feuilleté Jambon 23% : eau - farine de _blé_ - margarine (graisses végétales de palme et de colza - eau - sel - émulsifiant : E471 - correcteur d\'acidité : E330) - jambon cuit choix 5,4%* (jambon de porc - eau - sel - arômes naturels -  légumes en poudre - ferments) - préparation déshydratée pour sauce (_lactosérum_  - amidon transformé de pomme de terre - poudre de _lait_  entier - sel - épaississant : E415 - poivre - muscade) - _beurre_  - graine de pavot - chapelure (farine de _blé_ - eau - sel - levure) - sel - arôme naturel - _oeuf_ entier en poudre - blanc d\'_oeuf_ - ail - poivre noir - persil - muscade. Feuilleté Fromage 20,1% : eau - farine de _blé_ - margarine (graisses végétales de palme et de colza - eau - sel - émulsifiant : E471 - correcteur d\'acidité : E330) - _emmental_ râpé 5,6%* - préparation déshydratée pour sauce (_lactosérum_ - amidon transformé de pomme de terre - amidon de _blé_ - huile végétale de colza -  poudre de _lait_ écrémé - épaississant : E401 - sirop de glucose - protéines de _lait_ - arômes naturels - poivre noir - muscade) - _roquefort_ fondu 3,4%*(_roquefort_  - eau - amidon transformé de pomme de terre - sels de fonte : E331) - préparation fromagère aromatisée en poudre 2,8%* (poudre de _lactosérum_ - poudre de _crème_ - poudre de _fromages_ - sel - arômes naturels) - _parmesan_ râpé 0,8%* - sel - chapelure (farine de _blé_ - eau - sel - levure) - blanc d\'_œuf_ - _œuf_ entier poudre - amidon transformé de tapioca - poivre noir. *Pourcentages exprimés par rapport à chaque feuilleté. Traces de _crustacés_, _soja_, _fruits à coque_, _céleri_, _moutarde_, _graines de sésame_, _mollusques_.', '', '16', '8.6', '29', '2.5', '0', '5.1', '1.4', '0.551181102362205', '', '0');

