VALUES ('3222472864776', '24 mini tartelettes surgelées', 'Mini-tartelette  olive tomate fromages 27% : Farine de _blé_ -  oignon - olive noire dénoyautée 12,6% (olive - eau - sel - stabilisant : E579) - margarine (graisses végétales de palme et de coco - eau - huile végétale  de colza - émulsifiant : E471 - correcteur d\'acidité : E330) - eau - purée de tomate 8,2% -  _emmental_ râpé 2,8% - amidon de _blé_ - _parmesan_ râpé 1,7% - huile végétale de tournesol - amidon transformé de pomme de terre - sel - _lactosérum_ et protéines de _lait_  - sucre - poudres à lever : E450 et E500 (contient _blé_)  - arôme - persil. Mini-tartelette  quiche lardon cuit fumé 26% : Eau - farine de _blé_ -  margarine (graisses végétales de palme et de coco - eau - huile végétale  de colza - émulsifiant : E471 - correcteur d\'acidité : E330) - _oeuf_ - lardon cuit fumé 6,4 % (poitrine de porc - sel - dextrose - arôme de fumée - correcteur d\'acidité : E330 - antioxydant : E316 - conservateur : E250) - jambon fumé standard cuit goût fumé 6,4% (jambon de porc - eau - dextrose - sirop de glucose - protéines de sang - sel - stabilisants : E450, E451 - arômes dont arôme de fumée - gélifiants : E407, E410 et E415 - antioxydant : E301 - conservateur : E250) - _lait_ écrémé en poudre - amidon de _blé_ - amidon transformé de pomme de terre - huile végétale de tournesol - arôme (contient  _blé_ et _lait_) - sel - _lactosérum_ et protéines de _lait_  - sucre - poivre - poudres à lever : E450 et E500 (contient  _blé_). Mini-tartelette  saumon oseille 24% : Farine de _blé_ - eau - margarine (graisses végétales de palme et de coco - eau - huile végétale  de colza - émulsifiant : E471 - correcteur d\'acidité : E330) - _crème_ (_crème_ - stabilisant : E407) - préparation à base de pulpe de _saumon_ 6,9% [chair de _saumon_ cuit (_saumon_ Salmo salar - sel) - fumet aromatisé de _poisson_ (sel - arôme (contient  _blé_) - maltodextrine - amidon - épices et plantes aromatiques (contient _céleri_) - _poisson_ déshydraté - acidifiant : E330)] - _œuf_ - oseille 3,2% - amidon de _blé_ -  amidon transformé de pomme de terre - _lait_ écrémé en poudre - huile végétale de tournesol - fumet aromatisé de _poissons_ [sel - maltodextrines - dextrose - arômes naturels (contient  _mollusques_) - _poissons_ - _crevettes_ - oignon] - sel - _lactosérum_ et protéines de _lait_ - sucre -  vin de Madère modifié (vin de Madère - sel - arôme naturel) - poudres à lever : E450 et E500 (contient  _blé_) -  préparation à base de jus concentré de citron et de pulpe de citron jaune (jus concentré de citron - correcteur d\'acidité : E330 - eau - pulpe de citron - sucre - citron) - poivre.  Mini-tartelette aux 2 fromages 23% : Farine de _blé_ - eau - margarine (graisses végétales de palme et de coco - eau - huile végétale  de colza - émulsifiant : E471 - correcteur d\'acidité : E330) - _emmental_ râpé 12,4% - _œuf_ - amidon de _blé_ -  _lait_ écrémé en poudre - amidon transformé de pomme de terre - huile végétale de tournesol - _parmesan_ râpé 0,9% - sel - _lactosérum_ et protéines de _lait_ - sucre -  poudres à lever : E450 et E500 (contient  _blé_) - poivre. Pourcentages exprimés sur chaque tartelette. Traces de _moutarde_, _sésame_, soja, lupin et de _fruits à coque_.', '', '17', '7.9', '30', '3.4', '', '7.5', '1.4', '0.551181102362205', '', '0');

