INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3222473213597', 'Assortiment de 12 macarons congelés : 3 à la pistache, 3 à la framboise, 3 au café, 3 au chocolat', 'MACARON PISTACHE : Sucre - _amandes_ - blanc d\'_œuf_ liquide - _beurre_ - _œuf_ - préparation à base de _pistache_ 1.9% (_pistaches_ vertes 0.95% - sirop de sucre - eau - arôme naturel) - _crème_ (_crème_ - stabilisant : carraghénanes - émulsifiant : esters lactiques des mono - et diglycérides d\'acide gras) - amidon de mais - albumine d\'_\'_ - acidifiant : acide citrique - gélifiant : gomme xanthane - agent foisonnant : citrate de triéthyle - colorants : extrait végétal de curcuma, riboflavine phosphate, complexes cuivre-chlorophyllines - eau. MACARON FRAMBOISE : Sucre - fourrage framboise 23% (framboises 37% - sucre - sirop de glucose-fructose - gélifiants : alginate de sodium, pectines - acidifiant : acide citrique) - _amandes_ - blanc d\'_œuf_ liquide - colorant : concentré de jus de betterave - amidon de mais - albumine d\'_œuf_ - correcteur d\'acidité : acide citrique - gélifiant : gomme xanthane - agent foisonnant : citrate de triéthyle. MACARON CAFE : Sucre - _amandes_ - blanc d\'_œuf_ liquide - _beurre_ - _œuf_ - _crème_ (_crème_ - stabilisant : carraghénanes - émulsifiant : esters lactiques des mono - et diglycérides d\'acide gras) - amidon de mais - extrait de café 0.8% - colorant : caramel ordinaire - albumine d\'_œuf_ - acidifiant : acide citrique - gélifiant : gomme xanthane - agent foisonnant : citrate de triéthyle. MACARON CHOCOLAT : Sucre - _amandes_ - blanc d\'_œuf_ liquide - chocolat 10% (pâte de cacao - saccharose - émulsifiant : lécithines de _soja_ ) - _crème_ (_crème_ - stabilisant : carraghénanes - émulsifiant : esters lactiques des mono - et diglycérides d\'acide gras) - _beurre_ - amidon de maïs - poudre de malt d\'_orge_ - sirop de sucre inverti - colorant : concentré de jus de betterave - poudre de cacao 0.2% - acidifiant : acide citrique - gélifiant : gomme xanthane - albumine d\'_œuf_ - agent foisonnant : citrate de triéthyle. Traces d\'_arachide_, de _sésame_, de _sulfites_ et d\'autres _fruits à coques_.', 'https://static.openfoodfacts.org/images/products/322/247/321/3597/front_fr.6.400.jpg', '20', '5.9', '55', '51', '', '9.8', '0.15', '0.0590551181102362', '', '0');

