VALUES ('3222473213887', 'Craquant au chocolat et son croustillant au praliné', 'Mousse au chocolat noir 55,5% : _crème_ fraîche - chocolat noir 22% (pâte de cacao -  sucre -  émulsifiant : lécithine de _soja_ - arôme naturel de vanille) - jaune d\'_œuf_ - sucre liquide - eau - _beurre_  - cacao en poudre - sucre. (Pourcentage exprimé sur la mousse au chocolat noir). Croustillant au praliné et au chocolat noir 27,85% : pâte de praliné 43% (sucre -  _noisette_ - huile de _noisette_) - chocolat noir 20% (pâte de cacao - sucre - émulsifiant : lécithine de _soja_ - arôme naturel de vanille) - billes de riz soufflé au chocolat noir [chocolat noir (pâte de cacao - sucre - émulsifiant : lécithine de tournesol - extrait de vanille) - riz soufflé (riz - _blé_ - malt de _blé_ -  saccharose - _gluten de blé_ - dextrose - sel)] - huile de tournesol - brisures de crêpe dentelle (farine de _blé_ - sucre - _beurre_ - _lait_ écrémé en poudre - malt d\'_orge_ - sel) - cacao en poudre. (Pourcentages exprimés sur le croustillant au praliné et au chocolat noir).  Génoise au cacao 13,9% : _œuf_ - sucre - farine de _blé_ - cacao en poudre 6% - jaune d\'_œuf_. (Pourcentage exprimé sur la génoise au cacao).  Décor 2,1% : Copeaux de chocolat (sucre - pâte de cacao - beurre de cacao - matière grasse _laitière_ anhydre - émulsifiant : lécithines de _soja_ - arôme naturel de vanille - cacao maigre en poudre) - eau - sucre - cacao en poudre - _crème_ fraîche - sirop de sucre inverti - gélatine de bœuf.  Velours au chocolat noir 0,65% : chocolat noir 60% (pâte de cacao - sucre - émulsifiant : lécithine de _soja_ - arôme naturel de vanille) - beurre de cacao - huile de tournesol. (Pourcentage exprimé sur le velours au chocolat noir). Traces d\'autres _fruits à coque_, de _graines de sésame_.', 'https://static.openfoodfacts.org/images/products/322/247/321/3887/front_fr.3.400.jpg', '29', '13', '33', '27', '4.3', '6.6', '0.16', '0.062992125984252', '', '0');

